In every GTK application that I write, I start by setting up an event handler and attaching it to GLib's default executor. By using this event-driven approach, you can eliminate the need for reference counters, and potentially getting trapped in complex cyclic reference disasters. We can achieve this using a channel, creating a future that handles events received from the channel, and attaching that future to GLib's default executor. Whenever we program the signals in our widgets, we will attach the Sender to the connect_method(), pass an Event enum through that Sender, and then the Receiver in the event-handler will match that Event and do what we want to the application. use std::process; enum Event { Clicked
} fn main() { glib::set_program_name("First GTK App".into()); glib::set_application_name("First GTK App"); // Initialize GTK before proceeding. if gtk::init().is_err() { eprintln!("failed to initialize GTK Application"); process::exit(1); } // Attach `tx` to our widgets, and `rx` to our event handler let (tx, rx) = async_channel::unbounded(); // Processes all application events received from signals let event_handler = async move { while let Ok(event) = rx.recv().await { match event { Event::Clicked => { } } } }; // GLib has an executor in the background that will // asynchronously handle our events on this thread glib::MainContext::default().spawn_local(event_handler); // Thread will block here until the application is quit gtk::main();
}

